}
});

}
function expander_hide(param) {
jQuery("div"+param).hide();
linkname = jQuery("a"+param).html();
collapse_text  = "czytaj wiecej";
expand_text    = "zwin";
collapse_text_length = jQuery("<span />").html(collapse_text).text().length;
